import React, { useState, useEffect } from 'react';
import { skillsAPI } from '../services/api';

const Skills = () => {
  const [skills, setSkills] = useState([]);
  const [newSkill, setNewSkill] = useState({ name: '', type: 'offered' });
  const [loading, setLoading] = useState(false);

  useEffect(() => {
    fetchSkills();
  }, []);

  const fetchSkills = async () => {
    try {
      const response = await skillsAPI.getSkills();
      setSkills(response.data);
    } catch (error) {
      console.error('Error fetching skills:', error);
    }
  };

  const addSkill = async (e) => {
    e.preventDefault();
    if (!newSkill.name.trim()) return;

    setLoading(true);
    try {
      await skillsAPI.addSkill(newSkill);
      setNewSkill({ name: '', type: 'offered' });
      fetchSkills();
    } catch (error) {
      alert('Error adding skill');
    }
    setLoading(false);
  };

  const deleteSkill = async (id) => {
    try {
      await skillsAPI.deleteSkill(id);
      fetchSkills();
    } catch (error) {
      alert('Error deleting skill');
    }
  };

  const offeredSkills = skills.filter(skill => skill.type === 'offered');
  const wantedSkills = skills.filter(skill => skill.type === 'wanted');

  return (
    <div className="max-w-4xl mx-auto">
      <h1 className="text-3xl font-bold mb-8">My Skills</h1>

      {/* Add New Skill */}
      <div className="bg-white p-6 rounded-lg shadow-md mb-8">
        <h2 className="text-xl font-semibold mb-4">Add New Skill</h2>
        <form onSubmit={addSkill} className="flex gap-4">
          <input
            type="text"
            value={newSkill.name}
            onChange={(e) => setNewSkill({...newSkill, name: e.target.value})}
            placeholder="Enter skill name"
            className="flex-1 px-3 py-2 border rounded-lg focus:outline-none focus:border-primary"
            required
          />
          <select
            value={newSkill.type}
            onChange={(e) => setNewSkill({...newSkill, type: e.target.value})}
            className="px-3 py-2 border rounded-lg focus:outline-none focus:border-primary"
          >
            <option value="offered">I Can Teach</option>
            <option value="wanted">I Want to Learn</option>
          </select>
          <button
            type="submit"
            disabled={loading}
            className="bg-primary text-white px-6 py-2 rounded-lg hover:bg-blue-600 disabled:opacity-50"
          >
            {loading ? 'Adding...' : 'Add Skill'}
          </button>
        </form>
      </div>

      <div className="grid grid-cols-1 md:grid-cols-2 gap-8">
        {/* Skills I Can Teach */}
        <div className="bg-white p-6 rounded-lg shadow-md">
          <h2 className="text-xl font-semibold mb-4 text-green-600">Skills I Can Teach</h2>
          {offeredSkills.length === 0 ? (
            <p className="text-gray-500">No skills added yet</p>
          ) : (
            <div className="space-y-2">
              {offeredSkills.map((skill) => (
                <div key={skill.id} className="flex items-center justify-between bg-green-50 p-3 rounded-lg">
                  <span className="font-medium">{skill.name}</span>
                  <button
                    onClick={() => deleteSkill(skill.id)}
                    className="text-red-500 hover:text-red-700"
                  >
                    ✕
                  </button>
                </div>
              ))}
            </div>
          )}
        </div>

        {/* Skills I Want to Learn */}
        <div className="bg-white p-6 rounded-lg shadow-md">
          <h2 className="text-xl font-semibold mb-4 text-blue-600">Skills I Want to Learn</h2>
          {wantedSkills.length === 0 ? (
            <p className="text-gray-500">No skills added yet</p>
          ) : (
            <div className="space-y-2">
              {wantedSkills.map((skill) => (
                <div key={skill.id} className="flex items-center justify-between bg-blue-50 p-3 rounded-lg">
                  <span className="font-medium">{skill.name}</span>
                  <button
                    onClick={() => deleteSkill(skill.id)}
                    className="text-red-500 hover:text-red-700"
                  >
                    ✕
                  </button>
                </div>
              ))}
            </div>
          )}
        </div>
      </div>
    </div>
  );
};

export default Skills;
